class HeroList extends React.Component {



    render() { 

        //let heroList: Hero[] = heroRoster._heroes
        let allyHeroes: string = "berserker, archer, huh"
        let enemyHeroes: string = "warrior, blacksmith, etc..."

        return ( 
        <div>
            <h1>Your Team</h1>
            <span className="badge text-bg-primary">{allyHeroes}</span> 
            <h1>Enemy Team</h1>
            <span className="badge text-bg-primary">{enemyHeroes}</span> 
            </div>
        );
    }
}

export default HeroList;
